from typing import List
from typing import Optional


class Solution:
    # 41ms(36.97%)
    def findTheDifference2(self, s: str, t: str) -> str:
        res, see = [], []
        for w in t:
            if w in see:
                continue
            else:
                if s.count(w) != t.count(w):
                    return w
                    # [Step1]１つだけ追加されたとしているので、これでOK
                    # 41ms(36.97%) -> 35ms(70.71%)
                    # res.append(w)
                see.append(w)
        # [Step1]不要
        # return "".join(res)

    # [Step2] 比較回数を減らす作戦
    # [Step2]masterを持って処理したが効果は変化なし(35ms(70.71%))
    def findTheDifference(self, s: str, t: str) -> str:
        # [Step3]利用されていないアルファベットもあるので無駄が多い
        # 追加されている側の文字でsetを取ってそれをマスタにすると改善
        # 35ms(70.71%) -> 29ms(93.14%)
        # M = "abcdefghijklnmopqrstuvwxyz"
        M = set(t)
        for m in M:
            if s.count(m) < t.count(m):
                return m

    def test(self, input, answer):
        assert input == answer, "期待する値[{1}], 入力値[{0}]".format(input, answer)


def main():
    sol = Solution()
    # s, t = "abcd", "abcde"
    s = ""
    t = ""

    output = "t"
    sol.test(sol.findTheDifference(s, t), output)


if __name__ == "__main__":
    main()
